import './App.css';

function App() {
  return (
    <div className="App"> 
    <Landing/>

      <Route path='/home' component={<Home/>}/>
      {/* <Route path='/detail/:id' component={<Detail/>}/>
      <Route path='/form' component={<Form/>}/> */}
    </div>
  );
}

export default App;
